import React, { useEffect, useState } from 'react';
import './Styles/Profile.css';
import { useNavigate } from 'react-router-dom';
import Menu from "./Menu";

const Profile = () => {
    const navigate = useNavigate();
    const[menuActive,setMenuActive]=useState(false);
    const[isChecked,setIsChecked]=useState(false);

    const[userImage,setUserImage]=useState('12');
    const redirectTo = (url) => {
        navigate(url);
    };
    const [socialMedia, setSocialMedia] = useState({
        telegram: '',
        vk: '',
        instagram: ''
    });

    const handleChange1 = (e) => {
        const {name, value} = e.target;
        setSocialMedia({
            ...socialMedia,
            [name]: value
        });
    }


    const userInfo=async ()=> {
        try {
            const response = await fetch('https://localhost:8080/api/userInfo',{
                method:'GET',credentials:'include'});
            const user=response.text()
            setUserImage(await user)
        } catch (error) {
            console.error('Error:', error);

        }
    }
    useEffect(()=>
    {
        userInfo();
    });
    const handleChange = (event) => {
        const checked = event.target.checked;
        setIsChecked(checked);

        if (checked) {
            document.body.style.backgroundColor = '#2e2e2e';
        } else {
            document.body.style.backgroundColor = 'lightgrey';
        }
    };



        return (
            <div >


                <nav>

                    <div className='burger-btn' onClick={() => setMenuActive(!menuActive)}>

                        <span className={menuActive ? 'deva' : 'deva active'}/>

                    </div>

                </nav>
                <main>
                    <div>
                        <img id="myImage" src={`https://localhost:8080/api/images/${userImage}`}
                             alt="Profile"/>
                    </div>

                </main>

                <button className="back_up" onClick={() => redirectTo('/')}>Назад</button>
                <div className="toggle-switch">
                    <input type="checkbox" id="toggle" className="toggle-input"checked={isChecked}
                           onChange={handleChange}/>
                    <label htmlFor="toggle" className="toggle-label" ></label>
                </div>
                <Menu active={menuActive} setActive={setMenuActive}/>
                <div style={{ padding: '20px', maxWidth: '400px', margin: '0 auto', border: '1px solid #ccc', borderRadius: '5px' }}>
                    <h2>Введите данные соцсетей</h2>
                    <div style={{ marginBottom: '10px' }}>
                        <label style={{ display: 'block', marginBottom: '5px' }}>Telegram:</label>
                        <input
                            type="text"
                            name="telegram"
                            value={socialMedia.telegram}
                            onChange={handleChange}
                            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
                        />
                    </div>
                    <div style={{ marginBottom: '10px' }}>
                        <label style={{ display: 'block', marginBottom: '5px' }}>VK:</label>
                        <input
                            type="text"
                            name="vk"
                            value={socialMedia.vk}
                            onChange={handleChange1}
                            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
                        />
                    </div>
                    <div style={{ marginBottom: '10px' }}>
                        <label style={{ display: 'block', marginBottom: '5px' }}>Instagram:</label>
                        <input
                            type="text"
                            name="instagram"
                            value={socialMedia.instagram}
                            onChange={handleChange}
                            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
                        />
                    </div>
                    <div>
                        <h3>Результаты:</h3>
                        <p>Telegram: {socialMedia.telegram}</p>
                        <p>VK: {socialMedia.vk}</p>
                        <p>Instagram: {socialMedia.instagram}</p>
                    </div>
                </div>

            </div>
        );


};

export default Profile;
